import React from 'react';
import styles from './Tour.module.css';
const Tours = ({ tours }) => {
  return (
    <div className={styles.title}>
      <h2>Tourse setup</h2>
      <div className={styles.underline}> </div>
    </div>
  );
};

export default Tours;
